import React, { createContext } from 'react';
import app from 'firebase/app';
import 'firebase/auth';
import 'firebase/firestore';

export const FirebaseContext = createContext(null);

export const FirebaseProvider = ({ children }) => {

    const config = {
        apiKey: "AIzaSyBFjEVL0qZ_AwbVMQwl40pTmYNO-nd6QBc",
        authDomain: "arbetsprov-willandskill-marcel.firebaseapp.com",
        databaseURL: "https://arbetsprov-willandskill-marcel.firebaseio.com",
        projectId: "arbetsprov-willandskill-marcel",
        storageBucket: "arbetsprov-willandskill-marcel.appspot.com",
        messagingSenderId: "302630676827",
        appId: "1:302630676827:web:69f6123fef0b364b0e927e"
    };

    if (!app.apps.length) {
        app.initializeApp(config);
    }

    return <FirebaseContext.Provider value={app}>{children}</FirebaseContext.Provider>;
}
